import React from "react";
import TournamentForm from "../components/Form/form";

function Home() {
  return (
    <div className="home">
      <div className="grid-container">
        <div className="grid-item">
          <TournamentForm/>
        </div>
      </div>
    </div>
  );
}

export default Home;
